package blockchain

import (
	"encoding/hex"
	"github.com/project-illium/ilxd/types/transactions"
	"github.com/project-illium/ilxd/zk"
	"github.com/stretchr/testify/assert"
	"google.golang.org/protobuf/proto"
	"os"
	"testing"
)

func TestMain(m *testing.M) {
	zk.LoadZKPublicParameters()
	os.Exit(m.Run())
}

func TestProofValidator(t *testing.T) {
	proofCache := NewProofCache(10)
	proofValidator := NewProofValidator(proofCache, &zk.LurkVerifier{})

	stdTxBytes, err := hex.DecodeString("")
	assert.NoError(t, err)

	var standardTx transactions.StandardTransaction
	err = proto.Unmarshal(stdTxBytes, &standardTx)
	assert.NoError(t, err)

	mintTxBytes, err := hex.DecodeString("")
	assert.NoError(t, err)

	var mintTx transactions.MintTransaction
	err = proto.Unmarshal(mintTxBytes, &mintTx)
	assert.NoError(t, err)

	stakeTxBytes, err := hex.DecodeString("")
	assert.NoError(t, err)

	var stakeTx transactions.StakeTransaction
	err = proto.Unmarshal(stakeTxBytes, &stakeTx)
	assert.NoError(t, err)

	coinbaseTxBytes, err := hex.DecodeString("")
	assert.NoError(t, err)

	var coinbaseTx transactions.CoinbaseTransaction
	err = proto.Unmarshal(coinbaseTxBytes, &coinbaseTx)
	assert.NoError(t, err)

	treasuryTxBytes, err := hex.DecodeString("")
	assert.NoError(t, err)

	var treasuryTx transactions.TreasuryTransaction
	err = proto.Unmarshal(treasuryTxBytes, &treasuryTx)
	assert.NoError(t, err)

	err = proofValidator.Validate([]*transactions.Transaction{
		transactions.WrapTransaction(&standardTx),
		transactions.WrapTransaction(&mintTx),
		transactions.WrapTransaction(&stakeTx),
		transactions.WrapTransaction(&coinbaseTx),
		transactions.WrapTransaction(&treasuryTx),
	})
	assert.NoError(t, err)

	c := ValidateTransactionProof(transactions.WrapTransaction(&coinbaseTx), NewProofCache(10), &zk.LurkVerifier{})
	err = <-c
	assert.NoError(t, err)
}
